class StartPage(BasePage):
  """ https://cloud.google.com/appengine/docs/python/modules/#startup
      /_ah/start
  """
  def get(self):
    logging.info('###~###~###~###~###~### :: BasePage.StartPage.get()')
    self.response.out.write("START PAGE")

class WarmUpPage(BasePage):
  """ https://cloud.google.com/appengine/docs/python/warmup-requests/configuring
      /_ah/warmup
  """
  def get(self):
    logging.info('###~###~###~###~###~### :: BasePage.WarmUpPage.get()')
    self.response.out.write("WARM UP")

class ErrorPage(BasePage):
  def get(self, error_path):
    message = '%s not found!'%error_path
    self.error(404)
    self.response.out.write("""
<!doctype html>
    <head>
        <title>404</title>
    </head>
    <body style="background:black;color:yellow;border:5px double darkred;border-radius:12px;padding:5px;">
        <pre style="background:black;color:whitesmoke;padding:5px;font-family: "Courier New", Monospace;">%s</pre>
    </body>
</html>
""" % message)